Особливі випадки: 
1. Якщо тривалий менструальний цикл для жінок становить близько 28 днів, ви можете звернутися до цього додатка; 
2. Жінки, менструальний цикл яких занадто короткий або занадто довгий, не застосовуються до цього додатка; 
3. Різні причини призведуть до зміни періоду безпеки, тому ця програма призначена лише для ознайомлення, а не як ефективний контрацептив.

